export default class GameFilter extends React.Component{
    constructor(props){
        super(props)
        this.state={
            value:""
        }
    }
    handleSubmit=(event)=>{
        this.setState({
          value: event.target.value
        })
      }

render(){
    return(
        <form style={{padding:"10px"}} >
        <label>
          Search: 
        <input onChange={this.props.handleSubmit}></input>
        </label>

      </form>
    )
}
